import React from 'react';
import './AluguelOnibus.css'; // Crie um arquivo CSS se necessário

function AluguelOnibus() {
    return (
        <div className="aluguel-onibus-page">
            <h1>Aluguel de Ônibus</h1>
            <p>Conteúdo provisório para a página de aluguel de ônibus.</p>
        </div>
    );
}

export default AluguelOnibus;
